import React from "react";
import data from "../data/data";


const MyTabPanel = (props) => {
    return (
        <div>
            <Title />
            <ReactTabs.Tabs>
            <ReactTabs.TabList>
                { data.map(project => <ReactTabs.Tab>{project}</ReactTabs.Tab>) }
            </ReactTabs.TabList>
               <ReactTabs.TabPanel>Contents 1</ReactTabs.TabPanel>
            </ReactTabs.Tabs>
        </div>
    );
};

export default MyTabPanel;
